import { GET_ERRORS } from "../actions/types";
const initialState = {};
export default function(state = initialState, action) {
  switch (action.type) {
    case GET_ERRORS:
      console.log("GET_ERRORS action.payload: ", action.payload)
      const newErrors = {}
      return action.payload;
    default:
      return state;
  }
}
